import React from "react";
import axios from "axios";
import './styles/inicio.css';
import Nav from "./navVendedor";

export class Inventario extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            producto : []
        };
    };

    async componentDidMount() {
        const producto = await axios.get(`http://localhost:5000/producto/listar`);
        this.setState({producto: producto.data});
    };

    render() {        
        return (    
            <>
            <Nav/>
                <div className="container-producto">
                    <h1>Inventario</h1>
                    <br/><br/>
                    <button>Agregar producto</button>
                    <br/><br/>
                    <table className="table">
                        <thead>
                            <tr>
                                <th>Referencia</th>
                                <th>Nombre</th>
                                <th>Precio</th>
                                <th>Stock</th>
                                <th>Categoria</th>
                                <th>Descripcion</th>
                                <th>Puntos</th>
                                <th>% de donacion</th>
                            </tr>
                        </thead>
                        <tbody>
                            {this.state.producto.map((producto, index) => {
                                
                                    <td>{producto.nombre}</td>
                            })}
                        </tbody>
                    </table>
                </div>
            </>        
        );
    };
};
